// Hobbies.js
import React from 'react';

function Hobbies() {
  return (
    <section id="Hobbies">
      <h2>Hobbies </h2>
      <ul>
      <li>Meditation</li>
        <li>Gardening</li>
        <li>Reading</li>
      </ul>
    </section>
  );
}

export default Hobbies;
